import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the shopping cart icon
    const cartButton = page.locator('div.cart');
    await cartButton.waitFor({ state: 'visible', timeout: 5000 });
    await cartButton.click();

    // Wait for the cart modal to appear
    const cartModal = page.locator('#cartModal');
    await cartModal.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot of the open modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Extract data to verify the modal is open and empty
    const modalVisible = await cartModal.isVisible();
    const emptyCartMessage = await page.locator('.empty-cart').textContent();

    return {
      success: true,
      action: "Opened the shopping cart modal",
      extractedData: {
        isModalVisible: modalVisible,
        cartStatusMessage: emptyCartMessage.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open the shopping cart modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
